# # Count the frequency of each nucleotide present in the sequence

# In[192]:


def Count_Freq_Nuc(seq):
  FreqDict = {
      'A': 0,
      'C': 0,
      'G': 0,
      'T': 0
  }

  for nucleotide in seq:
    FreqDict[nucleotide] += 1 # count 

  return FreqDict


