# # Protein search in open reading frame

# We are going to write a two function, one that is capable of finding possible proteins in the open reading frame of amino acids based on start **codons(M)** and stop codons **(_)** and another one that is capable of finding possible proteins in multiple open reading frames.

# In[228]:


def proteins_from_ORF(aa_seq):
    """
    Compute all possible proteins in an aminoacid sequence and return
    a list of possible proteins. From M(start) to _(stop) is considered
    a possible protein.
    """
    current_prot = []
    proteins = []
    
    for aa in aa_seq:
        if aa == '_': # if is a stop codon
            if current_prot: # if contains any protein
                for p in current_prot:
                    proteins.append(p) # add each protein
                    
                current_prot = [] # reset to empty list
                
        else:
            # start accumulating aminoacids if M was found
            if aa == 'M':
                # make a string
                current_prot.append("")
                
            # start accumulating aminoacids in the empty string
            # until _ was found     
            for i in range(len(current_prot)):
                current_prot[i] += aa
                
    return proteins
            


# In[229]:


def All_Proteins_From_ORFs(seq, start_pos=0, end_pos=0, ordered=False):
    
    # Converts sequence into aminoacids-----------
    # if there is a range you want 
    if end_pos > start_pos:
        # reading frames based on range
        RFs = ORFs(seq[start_pos : end_pos])
    else:
        # reading frames from entire seq
        RFs = ORFs(seq)
    #-----------------------------------    
    
    # Converts aminoacids reading frames to proteins-----------
    proteins = []
    for rf in RFs:
        # extract proteins from each reading frame and add to 
        # proteins list
        prots = proteins_from_ORF(rf) 
        for p in prots:
            proteins.append(p)
            
    #----------------------------------------------------------
    
    # Return longest length protein -> shortest length protein
    if ordered:
        return sorted(proteins, key=len, reverse=True)
    
    return proteins


